package com.example.biatechtestapp.model.chat

import com.example.biatechtestapp.model.chat.entities.ChatData
import kotlinx.coroutines.flow.Flow
import kotlinx.coroutines.flow.flow
import javax.inject.Inject

interface ChatRepository {


    fun getChats(): Flow<List<ChatData>>


    class ChatRepositoryImpl @Inject constructor() : ChatRepository {

        private val chats = listOf<ChatData>(
            ChatData(0, URL_1, "Test Name", "Короткое сообщение", "2м", 3),
            ChatData(
                1,
                URL_2,
                "Test Name",
                "Пример длинного сообщения, которое не влезает",
                "2м",
                2
            ),
            ChatData(
                2,
                URL_1,
                "Test Name",
                "Пример длинного сообщения, которое не влезает",
                "2м",
                0
            ),
            ChatData(3, URL_2, "Test Name", "Короткое сообщение", "2м", 10)
        )

        override fun getChats(): Flow<List<ChatData>> = flow{
            emit(chats)
        }
    }


    private companion object {
        const val URL_1 =
            "data:image/jpeg;base64,"
        const val URL_2 =
            "data:image/jpeg;base64,"
    }

}